import { FETCH_GET } from './types';

export const fetchResults = () => dispatch => {
        fetch(`http://hn.algolia.com/api/v1/items/1`, {method: 'GET'}, {headers: {
            'content-type': 'applications/json'
        }, 
    }).then(res => res.json()).then(results => dispatch({type: FETCH_GET, payload: results}));
    }
